import React, {Component} from 'react'

import Stack from '@mui/material/Stack';
import SnackbarContent from '@mui/material/SnackbarContent';


class Comment extends Component{
    render(){

        const styles = {
            ma:{
                margin: 'auto'
            },
            bg: {
              background: 'white',
              color:'black'
            }
          };

          const name = (<h1>jesse gray</h1>)
          const message = (<p>this is whree the message will be</p>)

        return(
            <div>
                <Stack spacing={2} sx={{ maxWidth: 760 }} style={styles.ma}>
                    <SnackbarContent 
                        style={styles.bg} name={name} message={message}

                    />
                </Stack>
            </div>
        )
    }
}

export default Comment;
